import { AUTH, LOGOUT } from "../constants/actionTypes";

const authReducer = (state, action) => {
  switch (action.type) {
    case AUTH:
      console.log(action?.data);

      return state;

    default:
      return state;
  }
};

export default authReducer;

//from here, we move to the index.js of our reducers and import it there
